description:
I en nyinspelning av 1973 ars Brittiska skrackthriller. Spelar Nicolas Cage
en ensam sheriff som soker sin vilsna dotter efter att hon forsvunnit till en
enslig o. Nar han ankommer dit, kanner han att nagonting pagar bland ons
hemlighetsfulla invanare, nar han borjar undersoka vad som pagar. 
Uptacker han en blandning av frammande sexuella ritualer, en skordefest
och formodligen aven manniskooffer...
